12 naujų automobilių „ Audi A6 “, įsigytų veiklos nuomos būdu, tarnaus  Lietuvos kelių policijos tarnybai . Naujieji automobiliai skirti patruliavimui magistraliniuose keliuose ir svarbių asmenų ir jų vadovaujamų delegacijų lydėjimui, tad tikėtina, jog automobilius pamatysime ir Kaune. Generalinio komisaro Lino Pernavo teigimu, automobilius pavyko išsinuomoti pigiau nei siūlo „Audi“ atstovai Lietuvoje. Kol rinkoje tokio automobilio kaina svyruoja apie 65 tūkst. eurų, po viešųjų pirkimų pasiūlyta vieno automobilio kaina su visa būtina komplektacija – 45 tūkst. 260 eurų. Šių „Audi“ komplektacija panaši į neseniai pristatyto nežymėto policijos automobilio „Audi A6 Quattro“. Galingųjų automobilių dėka pareigūnams bus dar lengviau susidoroti su pažeidėjais, siekiančiais pabėgti ir išvengti atsakomybės. Skiriasi ir naujųjų automobilių dizainas. Mėnesio pradžioje savo socialinio tinklo „Facebook“ paskyroje „ Lietuvos policija “ paviešino naujo dizaino variantą, kuris dabar puošia naujuosius automobilius. Tikėtina, kad toks dizainas bus taikomas ir ateityje įsigijus naujus automobilius. Senieji policijos automobiliai išliks tokie patys, kokie yra dabar ir jų dizainas nebus keičiamas. (function(d, s, i, r) {
